

CREATE TABLE `account_table` (
  `account_id` int(11) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(255) NOT NULL,
  `lastname` varchar(255) NOT NULL,
  `id_number` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `user_type` varchar(255) NOT NULL,
  `status` varchar(255) NOT NULL,
  PRIMARY KEY (`account_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;




CREATE TABLE `history_log` (
  `history_id` int(11) NOT NULL AUTO_INCREMENT,
  `account_id` int(11) NOT NULL,
  `activity` varchar(255) NOT NULL,
  `date_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`history_id`)
) ENGINE=MYISAM DEFAULT CHARSET=latin1 ROW_FORMAT=COMPRESSED;




CREATE TABLE `pwd_table` (
  `pwd_id` int(11) NOT NULL AUTO_INCREMENT,
  `pwd_number` varchar(255) NOT NULL,
  `pwd_lastname` varchar(255) NOT NULL,
  `pwd_firstname` varchar(255) NOT NULL,
  `pwd_middlename` varchar(255) NOT NULL,
  `pwd_suffix` varchar(255) DEFAULT NULL,
  `date_applied` date NOT NULL,
  `pwd_birthday` date DEFAULT NULL,
  `pwd_age` int(11) NOT NULL,
  `pwd_birthplace` varchar(255) NOT NULL,
  `pwd_sex` varchar(255) NOT NULL,
  `pwd_religion` varchar(255) NOT NULL,
  `pwd_ethnic_group` varchar(255) NOT NULL,
  `pwd_civil_status` varchar(255) NOT NULL,
  `pwd_blood_type` varchar(255) NOT NULL,
  `pwd_disability_type` varchar(255) NOT NULL,
  `pwd_disability_cause` varchar(255) NOT NULL,
  `pwd_house_street` varchar(255) NOT NULL,
  `pwd_barangay` varchar(255) NOT NULL,
  `pwd_landline` varchar(255) DEFAULT NULL,
  `pwd_mobile` varchar(11) DEFAULT NULL,
  `pwd_email` varchar(255) DEFAULT NULL,
  `pwd_education` varchar(255) NOT NULL,
  `pwd_employment_status` varchar(255) NOT NULL,
  `pwd_occupation` varchar(255) NOT NULL,
  `pwd_employment_category` varchar(255) DEFAULT NULL,
  `pwd_employment_type` varchar(255) DEFAULT NULL,
  `pwd_organization` varchar(255) DEFAULT NULL,
  `pwd_organization_contact` varchar(255) DEFAULT NULL,
  `pwd_organization_address` varchar(255) DEFAULT NULL,
  `pwd_organization_telephone` varchar(255) DEFAULT NULL,
  `pwd_sss` varchar(255) DEFAULT NULL,
  `pwd_gsis` varchar(255) DEFAULT NULL,
  `pwd_pagibig` varchar(255) DEFAULT NULL,
  `pwd_philhealth` varchar(255) DEFAULT NULL,
  `pwd_father_lastname` varchar(255) DEFAULT NULL,
  `pwd_father_firstname` varchar(255) DEFAULT NULL,
  `pwd_father_middlename` varchar(255) DEFAULT NULL,
  `pwd_mother_lastname` varchar(255) DEFAULT NULL,
  `pwd_mother_firstname` varchar(255) DEFAULT NULL,
  `pwd_mother_middlename` varchar(255) DEFAULT NULL,
  `pwd_guardian_lastname` varchar(255) DEFAULT NULL,
  `pwd_guardian_firstname` varchar(255) DEFAULT NULL,
  `pwd_guardian_middlename` varchar(255) DEFAULT NULL,
  `pwd_guardian_contact` varchar(255) DEFAULT NULL,
  `accomplished_lastname` varchar(255) NOT NULL,
  `accomplished_firstname` varchar(255) NOT NULL,
  `accomplished_middlename` varchar(255) NOT NULL,
  `reporting_unit` varchar(255) DEFAULT NULL,
  `registration_number` varchar(255) DEFAULT NULL,
  `pwd_living` varchar(255) NOT NULL,
  `pwd_spouse_name` varchar(255) DEFAULT NULL,
  `pwd_spouse_age` int(11) DEFAULT NULL,
  `pwd_support` varchar(255) DEFAULT NULL,
  `pwd_pensioner` varchar(255) DEFAULT NULL,
  `pwd_pensioner_type` varchar(255) DEFAULT NULL,
  `pwd_pension_monthly` varchar(255) DEFAULT NULL,
  `pwd_income_source` varchar(255) NOT NULL,
  `pwd_income_monthly` varchar(255) DEFAULT NULL,
  `interviewed_by` varchar(255) NOT NULL,
  `pwd_remarks` mediumtext,
  `pwd_accessibility` varchar(255) DEFAULT NULL,
  `pwd_services` varchar(255) DEFAULT NULL,
  `pwd_disability_cause_others` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`pwd_id`)
) ENGINE=MYISAM DEFAULT CHARSET=latin1 ROW_FORMAT=COMPRESSED;

